// so the target is to build a table

import React, { Component } from "react";
import { getMovies } from "../services/fakeGenreService";

export default class Table1 {
  constructor() {
    this.state = { movies: getMovies() };
  }

  render() {
    return (
      <table>
        <thead>
          <tr>
            <th></th>
            <th></th>
          </tr>
        </thead>
      </table>
    );
  }
}
